import './css/App.css';
import Header from './components/Header';
import HomePage from './components/HomePage';
import SnsPage from './components/SnsPage';
import { BrowserRouter as Router,  Route , Routes} from "react-router-dom"

function App() {
  return (
    <Router>
    <div className="App">
      <Header />

      <HomePage />
      <SnsPage />
    </div>
    </Router>
  );
}

export default App;
